#include "audio.h"
#include "sdram.h"



unsigned int size = 0;

//Crystal input seems to be 0. no clock output
	//possibly reason for DREQ always low?
void audio_initialize(){


	SSP_CFG_Type SSP_ConfigStruct;
	SSP_ConfigStructInit(&SSP_ConfigStruct);
	SSP_Init(LPC_SSP2, &SSP_ConfigStruct);
	SSP_Cmd(LPC_SSP2, ENABLE);

	//GPIOSetDir(1,16,GPIO_INPUT);  //dreq
	GPIOSetDir(1,10,GPIO_INPUT);  //dreq

	GPIOSetDir(1,14,GPIO_OUTPUT);  //xcs SET TO 0
	GPIOSetValue(1,14,1);

	GPIOSetDir(1,8,GPIO_OUTPUT);  //sd cs SET TO 1 TO DISABLE SDCARD SELECT
	GPIOSetValue(1,8,1);

	GPIOSetDir(1,13,GPIO_OUTPUT);  //bsync
	GPIOSetValue(1,13,1);

	GPIOSetDir(1,1,GPIO_OUTPUT); //mosi set to output
	GPIOSetDir(1,4,GPIO_INPUT); //miso set to input




}

void audio_reset(){
		GPIOSetValue(1,14,0);

		SSP_SendData(LPC_SSP2 ,0x02); //write
		SSP_SendData(LPC_SSP2, 0x00); //register 0
		SSP_SendData(LPC_SSP2, 0x08); //SM_SDINEW (vs1002 native SPI modes)
		SSP_SendData(LPC_SSP2, 0x04); //SM_RESET (software reset, clears on its own)



		//delay
		TIM_Waitus(5);

		GPIOSetValue(1,14,1);


		while(!GPIOGetValue( 1, 10)) ;

		GPIOSetValue(1,14,0);

		SSP_SendData(LPC_SSP2, 0x02); //write
		SSP_SendData(LPC_SSP2, 0x03); //register 3, clock
		SSP_SendData(LPC_SSP2, 0x98); //Eric thinks 98 (internal doubling, 12.8xx KHz external crystal)
		SSP_SendData(LPC_SSP2, 0x00);


		//delay
		TIM_Waitus(5);

		GPIOSetValue(1,14,1);

		while(!GPIOGetValue( 1, 10)) ;
}

void audio_test(){
		GPIOSetValue(1,14,1); //XCS
		GPIOSetValue(1,13,1); //BYSNC


		//for(i=0; i<(720);i++);

		TIM_Waitus(5);


		GPIOSetValue(1,14,0); //XCS

		SSP_SendData(LPC_SSP2, 0x02);      /* Send SPI Byte, then wait for byte to be sent.   */
		SSP_SendData(LPC_SSP2, 0x00);      /* 0x02 was WRITE command, 0x00 is register number */
		SSP_SendData(LPC_SSP2, 0x08);      /* This byte goes to MSB                           */
		SSP_SendData(LPC_SSP2, 0x20);      /* ..and this is LSB. (0x20=Allow Test Mode)       */


		TIM_Waitus(5);

		GPIOSetValue(1,14,1); //XCS


		 /* Wait for DREQ = 1  */
			while(!GPIOGetValue( 1, 10)) ;

			GPIOSetValue(1,13,0); //BYSNC


			SSP_SendData(LPC_SSP2, 0x53);      /* - This is a special VLSI Solution test header - */
			SSP_SendData(LPC_SSP2, 0xef);      /* - that starts a sine sound. It's good for     - */
			SSP_SendData(LPC_SSP2, 0x6e);      /* - testing your code and the chip. */
			SSP_SendData(LPC_SSP2, 0x44);
			SSP_SendData(LPC_SSP2, 0x00);
			SSP_SendData(LPC_SSP2, 0x00);
			SSP_SendData(LPC_SSP2, 0x00);
			SSP_SendData(LPC_SSP2, 0x00);

			TIM_Waitus(5);


			GPIOSetValue(1,13,1); //BYSNC


			while(!GPIOGetValue( 1, 10)) ;
}


void audio_setVolume(uint8 vol)
{

	while(!GPIOGetValue( 1, 10)) ;

	GPIOSetValue(1,14,0);

	// WRITE, set to test mode and SDI new mode
	SSP_SendData(LPC_SSP2, 0x02);      /* Send SPI Byte, then wait for byte to be sent.   */
	SSP_SendData(LPC_SSP2, 0x0B);      /* 0x02 was WRITE command, 0x00 is register number */
	SSP_SendData(LPC_SSP2, vol);
	SSP_SendData(LPC_SSP2, vol);

	TIM_Waitus(5);

	GPIOSetValue(1,14,1);

	while(!GPIOGetValue( 1, 10)) ;

}


void audio_setupMP3(){
	while(!GPIOGetValue( 1, 10)) ;


	GPIOSetValue(1,14,0); //XCS

	SSP_SendData(LPC_SSP2, 0x02);      /* Send SPI Byte, then wait for byte to be sent.   */
	SSP_SendData(LPC_SSP2, 0x00);      /* 0x02 was WRITE command, 0x00 is register number */
	SSP_SendData(LPC_SSP2, 0x08);      /* This byte goes to MSB                           */
	SSP_SendData(LPC_SSP2, 0x42);      /* ..and this is LSB. (0x22=SM_TESTS ENABLED AND MPEG LAYERS 1 AND 2)       */


	TIM_Waitus(5);

	GPIOSetValue(1,14,1); //XCS




	//RECIEVE SOUND FILE AND STORE INTO BUFFER
	//RECIEVE LOCATION OF BUFFER
	while(!GPIOGetValue( 1, 10)) ;

}

